The first issue is also wrong yeah. Most times you need to use either of these lines:
```
const float resXScale = (float($width)/float($gameWidth));
const float resYScale = (float($height)/float($gameHeight));
```
The one you have to choose depends on the shader. `8fdd009324e987ee` for example is used to blur the screen horizontally. So, you want to scale the effects horizontally (that's why it probably used `const float resScale = <?=$scaleFactorY?>;` before, I reckon), so you'll want to reapply the resYScale variable in the new Vulkan shaders to all the positions where it previously had resScale like:
```
R126f.x = intBitsToFloat(uf_remappedPS[0].x) * intBitsToFloat(0x404ec4ec)/ resScale;
```

